import React from "react";
const Navbar=() =>{
    return(
        <div className="text-white">
         <h1 className="w-full text-3xl font-bold text-[#00df9a]">Website</h1>
         <ul className="flex">
            <li className="p-4 font-serif">Home</li>
            <li className="p-4 font-serif">About Us</li>
            <li className="p-4 font-serif">Contact Us</li>
         </ul>
        </div>
    )
}
export default Navbar;
